import React from 'react';
import { useSelector } from 'react-redux';
import { addToCart } from '../store/cartSlice'; // Import addToCart action if needed

function Cart() {
  const cartItems = useSelector(state => state.cartItems);

  return (
    <div>
      <h2>Cart</h2>
      <ul>
        {cartItems.map(item => (
          <li key={item.id}>
            {item.name} - {item.price}
          </li>
        ))}
      </ul>
      <p>Total: {/* Calculate the final price */}</p>
    </div>
  );
}

export default Cart;
